import React from 'react';
import './ClientLogos.css';

const ClientLogos = () => {
  // Using placeholder logos from placeholder.com
  const logos = [
    { id: 1, src: 'https://via.placeholder.com/150x50?text=Client+1', alt: 'Client 1' },
    { id: 2, src: 'https://via.placeholder.com/150x50?text=Client+2', alt: 'Client 2' },
    { id: 3, src: 'https://via.placeholder.com/150x50?text=Client+3', alt: 'Client 3' },
    { id: 4, src: 'https://via.placeholder.com/150x50?text=Client+4', alt: 'Client 4' },
    { id: 5, src: 'https://via.placeholder.com/150x50?text=Client+5', alt: 'Client 5' },
    { id: 6, src: 'https://via.placeholder.com/150x50?text=Client+6', alt: 'Client 6' },
  ];

  return (
    <div className="client-logos">
      {logos.map(logo => (
        <div key={logo.id} className="logo-item">
          <img src={logo.src} alt={logo.alt} />
        </div>
      ))}
    </div>
  );
};

export default ClientLogos;
